from collections import  Counter
class Solution(object):
	def hasGroupsSizeX(self, deck):
		"""
		:type deck: List[int]
		:rtype: bool
		"""
		lookup = Counter(deck)
		# print(lookup)
		value_list = list(lookup.values())
		print(value_list)
		min_num = min(value_list)
		value_set = set(value_list)
		def helper(num):
			for i in value_set:
				if i % num != 0:
					return False
			return True
		for num in range(2,min_num+1):
			print(num)
			if helper(num):
				return True
		return False

